import { StatusBar } from "expo-status-bar"
import {Button, StyleSheet, Text, View, FlatList} from "react-native"
import { ListItem } from "@react-native-material/core";



export default function Odenes(){
    const DATA = [
        {
          id: '001',
          cliente: 'Juan',
          status:'Preparacion'
        },
        {
          id: '002',
          cliente: 'luis',
          status: 'entregado'
        },
        {
          id: '003',
          cliente: 'Maria',
          status:'preparacion'
        },
    ];
    return(
        <View>
            <Button title="Nueva Orden" onPress={() => navigation.navigate("Nuevo")} />
            <FlatList
                data={DATA}
                keyExtractor={(item) => item.id}
                renderItem={({item}) => (
                    <ListItem  onPress={() => navigation.navigate("menu")}>
                        title="Inbox"
                        leading={<Icon name="inbox" size={24} />}
                        trailing={props => <Icon name="chevron-right" {...props} />}
                       
                    </ListItem>

                )}
            />
        </View>
    );
}
